import React from "react";
import css from "./Users.module.css";

const Users = (props) => {
  let usersForm = props.users.map(
    (u = (
      <div className={css.form} key={u.id}>
        <div className={css.person}></div>
        <div className={css.data}>
          <div className={css.fullName}>{props.users.fullName}</div>
          <div className={css.location}>
            <div className={css.country}>{props.users.location.country}</div>
            <div className={css.city}>{props.users.location.city}</div>
          </div>
          <div className={css.status}></div>
        </div>
      </div>
    ))
  );
  return <div className={css.users}>{usersForm}</div>;
};

export default Users;
